   const [data,setData] = useState(null)

   useEffect(() => {
      axios.get(baseURL)
      .then((response)=> {
         setData(response.data)
         console.log(response.data)
      }).catch(err => {
         console.error(err)
      }
      )
      }, [] )


   return (
        <h1>Pearl Market</h1>

   ) 
}


